import React, { Component } from 'react';


class Sobre extends Component {
    render() {
        return (
            <div className='Sobre' >
                <h1>Sobre</h1>
                <br />
                <h2>somos um brecho feito para ajudar animais de rua</h2>
                <h2>100% da renda da renda arrecadada é destinada a </h2>
                <h2>castração e tratamento de animais de rua</h2>
            </div>
        )
    }
}


export default Sobre
